import { useState } from "react"

export const TicketPlayground = () => {

	const [command, setCommand] = useState({})

	const handleInput = event => {
		setCommand({
			...command,
			[event.target.name] : event.target.value
		})
	}

  return (
    <div>
      <h3>Playground</h3>

			{[
				{field: "kitchen", value: command.kitchen,  title: "Kitchen"},
				{field: "date", value: command.date,  title: "Date"},
			 	{field: "time", value: command.time,  title: "Time"},
			 	{field: "waiter", value: command.waiter,  title: "Waiter"},
			 	{field: "table", value: command.table,  title: "Table"}
			].map(input => 
				<input type="text" value={input.value} name={input.field} OnChange={handleInput}/>
			)}

				{JSON.stringify(command)}

    </div>
  );
}
